		introduce: "翟池位于镇原县东35公里、眉肖公路西侧的上肖境内。民国二年（公元1913年）古十一月，沟北原头滑塌，堵塞沟渠，形成湫池。因此地聚居翟姓，故曰翟池，又因此池，该村也命名为翟池村。翟池水位最深处为13米，水面面积18万平方米，总蓄水量126万立方米，流域面积1.33平方公里。池上游南端有泉眼一孔，以每秒4公升的流量注入池中。水质甘甜纯净，池中鱼类丰富，偶有龟鳌出没，水蛇穿行。春夏时节，碧波粼粼，柳黛成荫，鸟语花香，鳞鱼腾跃，构成一副绚丽美妙的天然景观，令垂钓者心旷神怡，使游人乐不思归。目前，县政府引资140万元，统一规划，合理布局，植树20万枝，建成宾馆、游泳池、钓鱼池、苹果园，购置游船20多艘。每年夏天南来北往的游客络绎不绝，大小车辆穿梭往来，画舫游荡，钓者往返，红男绿女嬉戏于花丛水畔，皓首老者避暑于翟池山庄。翟池已成庆阳一流的旅游胜地，开发潜力极大。",
