		introduce: "1948年春，中国人民解放军第一野战军第六纵队在西府陇东战役屯字镇战斗中，面对敌众我寡的形势，纵队将士坚持战斗两天两夜，给敌人以重大的杀伤，掩护野战军主力向北转移。但第六纵队的许多指战员在这次战斗中壮烈牺牲，其中有教导旅卫生部长王仲斌、团政委常祥考、团政治处主任赵明月等。为纪念英烈，启迪后人，激励人民群众的革命精神，1977年5月，中共镇原县委、县革命委员会在兰州军区空军部队（原第一野战军第六纵队）的大力支持和庆阳地区党政领导的关怀下，在屯字镇东街动工修建烈士陵园，于1979年4月竣工落成。占地3520平方米，建筑面积306平方米，四周为四明墙，前院为碑园，后院为陵园。总投资5.3万元，其中兰空部队资助2万元，地、县投资2.3万元。陵园大门两侧雕刻着毛泽东同志的诗句“为有牺牲多壮志，敢教日月换新天”。步入大门，甬道直通纪念碑，道旁是阅兵式的松柏。纪念碑仿天安门广场人民英雄纪念碑，钢筋混凝土结构。2000年以来，县政府先后投资53万元，建成半仿古式结构平房10间160平方米，增设展览厅、陈列室、接待室等。展览厅内布展了屯字镇战斗及屯字烈士陵园简介等，陈列室里陈列着部分屯字镇战斗遗物。同时重修了陵园大门，改建围墙300多米，对园内道路进行了硬化，院落进行了绿化和美化。该陵园先后被命名为市、县爱国主义教育基地和县中共党史教育基地。",
