		score: 4,
		introduce: "包家寨革命纪念馆为红色旅游经典景区。2013年9月，位于合水县蒿咀铺乡张举塬村的包家寨革命纪念馆维修落成正式开馆。1933年11月，在西北地区革命形势极度不利，革命斗争处于低潮的情况下，刘志丹、谢子长、习仲勋等陕甘边特委和红军临时指挥部组成人员在包家寨举行了联席会议，作出了恢复红二十六军成立红四十二师、进军南梁建立根据地、以南梁为中心建立三路游击区等三项重大决定，史称西北革命史上的“遵义会议”。这次会议从根本上挽救了陕甘边区党和红军，是陕甘边区革命斗争走向胜利的重要转折点，在西北革命斗争史上具有重大而深远的意义，毛泽东曾高度称赞这次会议的决策为“狡兔三窟”之策。包家寨革命纪念馆的建成和开放，不但为合水县、庆阳市乃至甘肃省爱国主义教育搭建了新的平台，为大力弘扬革命先烈精神提供了新的载体，而且还为合水红色旅游增添了新亮点。届时，包家寨革命纪念馆与延安、南梁、山城堡等红色景点一起构成我国北方红色经典旅游线路，成为合水又一张知名的红色文化旅游名片。",
