		introduce: "镇原县博物馆位于镇原县城文化广场东侧，1950年开始收藏和管护文物，1986年经镇原县人民政府批准成立，是一座以收藏、宣传、科研、陈列历史文物为主的综合性国家三级博物馆。1996年被列为镇原县爱国主义教育基地，2004年被确定为镇原县未成年人教育基地，2008年5月正式对外免费开放。目前馆藏文物以历史文物为主，门类齐全，涵盖了旧石器时代至今各历史年代的文物共5000多件，有陶器、瓷器、铜器、玉器、雕塑造像、石刻、砖瓦等16个门类。有珍贵文物771件:一级文物46件，二级文物56件，三级文物669件。其中常山下层文化陶水管独步全国，秦代铜诏版举世无双，汉代青铜器精美绝伦，历代佛教造像千姿百态，宋元明清瓷器弥足珍贵。第三次全国文物普查共调查不可移动文物点853处。在本地发现有“仰韶文化”、“常山下层文化”、“齐家文化”等古文化遗址492处， 古墓葬135处，古建筑13处，石窟寺及石刻13处，近现代史迹及代表性建筑182处，其他18处。其中全国重点文物保护单位2处，省级文物保护单位10处，市级文物保护单位17处，县级文物保护单位52处，引起学术界瞩目的有旧石器时代中期的太平姜家湾和寺沟口遗址、城关镇常山下层文化遗址、城关镇金龙行政村的石空寺石窟、太平镇的玉山寺石窟和彭阳古城、县委院内的文庙大成殿等。",
